 */

import { IEventId, IEventTime, ISuccess, TSuccessNumber, TSuccessString } from '../interfaces';

export const EVENT_SERVER_RENDER_START = 'ServerRenderEventStart';
export const EVENT_SERVER_RENDER_STOP = 'ServerRenderEventStop';
export const EVENT_RENDER_PAGE_START = 'RenderPageEventStart';
export const EVENT_RENDER_PAGE_STOP = 'RenderPageEventStop';
export const EVENT_RENDER_TO_STRING_START = 'RenderToStringEventStart';
export const EVENT_RENDER_TO_STRING_STOP = 'RenderToStringEventStop';
export const EVENT_BASEPAGE_CREATION_START = 'BasePageCreationEventStart';
export const EVENT_BASEPAGE_CREATION_STOP = 'BasePageCreationEventStop';
export const EVENT_JSON_STRINGIFY_START = 'JsonStringifyEventStart';
export const EVENT_JSON_STRINGIFY_STOP = 'JsonStringifyEventStop';
export const EVENT_REQUEST_PREP_START = 'RequestPrepEventStart';
export const EVENT_REQUEST_PREP_STOP = 'RequestPrepEventStop';
export const EVENT_COMPLEX_TYPE_START = 'ComplexTypeEventStart';
export const EVENT_COMPLEX_TYPE_STOP = 'ComplexTypeEventStop';

/**
 * Additional properties to send along with ending a request
 */
export interface IEventServerRenderProperties extends IEventId, ISuccess<TSuccessString> {}

export interface IEventServerRenderMetrics extends IEventTime, ISuccess<TSuccessNumber> {}
